import React, { useState } from 'react';
import axios from 'axios';
import './App.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import BusListComponent from './Component/BusListComponent';
import HeaderComponent from './Component/HeaderComponent';
import FooterComponent from './Component/FooterComponent';
import SearchBus from './Component/SearchBus';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import SearchBusWithName from './Component/SearchBusWithName';
import SearchWithNumberPlate from './Component/SerachWithNumberPlate';
import AddBusComponent from './Component/AddBusComponent';
import { About, Home } from './Component/Home';
import AddBussComponent from './Component/AddBussComponent';
import GetAllBusComponent from './Component/GetAllBusComponent';
import BusFormComponent from './Component/BusFormComponent';
import Payment from './Component/Payment';
import { UserComponent } from './Component/UserComponent';
import { AdminComponent } from './Component/AdminComponent';
import BusSearchWithCapacity from './Component/BusSearchWithCapacity';
import NumberPlateSearch from './Component/NumberPlateSearch';

function App() {
  return (
    <Router>
      <div>
      <HeaderComponent/>
     <div className='container1'>
          <ul>
          {/* <li>
              <Link to="/numberplate">Search Bus with Number Plate</Link>
            </li> */}
            {/* <li >
              <Link to="/getallbuses">Get All Buses</Link>
            </li>
            <li>
              <Link to="/searchbus">Search Bus</Link>
            </li>
            <li>
              <Link to="/searchbuswithname">Search Bus with Bus Name</Link>
            </li>

            <li>
              <Link to="/addbus">Add bus</Link>
            </li> */}
            {/* <li>
              <Link to="/bus-search-with-capacity">BusSearchWithCapacity</Link>
            </li> */}
          </ul>
          <Routes>
          <Route path="/" element={<Home/>}/>
          <Route path="/getAllBuses" element={<BusListComponent/>}/>
          <Route path="/searchBus" element={<SearchBus/>}/>
          <Route path='/searchBusWithName' element={<SearchBusWithName/>}/>
          {/* <Route path='/searchwithnumberplate' element={<NumberPlateSearch/>}/> */}
          <Route path='/bus-search-with-capacity' element={<BusSearchWithCapacity/>}/>
          <Route path='/addbus' element={<BusFormComponent/>}/>
          <Route path='/payment' element={<Payment/>}/>
          <Route path="/user" element={<UserComponent/>} />
          <Route path="/admin" element={<AdminComponent/>} />
          <Route path='/numberplate' element={<SearchWithNumberPlate/>}/>
        </Routes>
      </div>
      <FooterComponent />
    </div>
    </Router>
  );
  // return(
  //  
  //         <BusListComponent/>
  //       </div>
//       <FooterComponent />
//     </div>
//   // );
          }
export default App;
